import React, { useState } from "react";
import { Form, Row, Col } from "react-bootstrap";

function PlayerField({ stt, data, setData }) {
    const [playerData, setPlayerData] = useState({
        playerName: "",
        dayOfBirth: Date,
        playerType: String,
        playerNote: String,
        numberOfGoals: Number,
        numberOfAssits: Number,
    });

    return (
        <Row>
            <Col sm={1}>
                <Form.Group className="mb-3" style={{ textAlign: "center" }}>
                    {stt}
                </Form.Group>
            </Col>
            <Col sm={3}>
                <Form.Group className="mb-3">
                    <Form.Control
                        type="text"
                        value={playerData.playerName}
                        onChange={(e) =>
                            setPlayerData({
                                ...playerData,
                                playerName: e.target.value,
                            })
                        }
                    />
                </Form.Group>
            </Col>
            <Col sm={2}>
                <Form.Group className="mb-3">
                    <Form.Control
                        type="date"
                        value={playerData.dayOfBirth}
                        onChange={(e) =>
                            setPlayerData({
                                ...playerData,
                                dayOfBirth: e.target.value,
                            })
                        }
                    />
                </Form.Group>
            </Col>
            <Col sm={3}>
                <Form.Group className="mb-3">
                    <Form.Control
                        type="text"
                        value={playerData.playerType}
                        onChange={(e) =>
                            setPlayerData({
                                ...playerData,
                                playerType: e.target.value,
                            })
                        }
                    />
                </Form.Group>
            </Col>
            <Col sm={3}>
                <Form.Group className="mb-3">
                    <Form.Control
                        type="text"
                        value={playerData.playerNote}
                        onChange={(e) =>
                            setPlayerData({
                                ...playerData,
                                playerNote: e.target.value,
                            })
                        }
                    />
                </Form.Group>
            </Col>
        </Row>
    );
}

export default PlayerField;
